  p = 2 * k + 2;\r\n        if (heap[p] >= heap[k])\r\n            break;\r\n        heap[p] += heap[k];\r\n        heap[k] = heap[p] - heap[k];\r\n        heap[p] -= heap[k];\r\n        k = p;\r\n    }\r\n    return;\r\n}\r\n\r\nint main(int argc, char* argv[]) \r\n{\r\n    init();\r\n\r\n    int i;\r\n    clock_t start, end;\r\n    \r\n    start = clock();\r\n\r\n    calc_dis();\r\n\r\n    hn = 0;\r\n    memset(heap, 0, sizeof(heap));\r\n    for (i = 0; i < D_NUM; ++i)\r\n        if (dist[i] > heap[0]) {\r\n            heap[0] = dist[i];\r\n            sift_down();\r\n        }\r\n    \r\n    end = clock();    \r\n    \r\n    fprintf(stdout, \"Time is %.3lf\\n\", (double)(end - start) / CLOCKS_PER_SEC);\r\n    return(0);\r\n}\r\n\r\n'),(124,'Y','include <stdio.h>\r\n#include <string.h>\r\n#include <stdlib.h>\r\n#include <math.h>\r\n#include <time.h>\r\n\r\n#define D_NUM 1024\r\n#define P_NUM 128\r\n#define RANGE 256\r\n#define H_NUM 50\r\n\r\ntypedef struct {\r\n    char p[P_NUM];\r\n} query_point;\r\n\r\nquery_point data_points[D_NUM];\r\nquery_point q_point;\r\n\r\nint dist[D_NUM];\r\nint heap[H_NUM];\r\nint hn;\r\n\r\nvoid init() \r\n{\r\n    srand((unsigned)time(NULL));\r\n\r\n    int i, j;\r\n\r\n    for (i = 0; i < D_NUM; ++i)\r\n        for (j = 0; j < P_NUM; ++j)\r\n            data_points[i].p[j] = rand() % RANGE;\r\n\r\n    for (j = 0; j < P_NUM; ++j)\r\n        q_point.p[j] = rand() % RANGE;\r\n\r\n    return;\r\n}\r\n\r\nvoid calc_dis()\r\n{\r\n    int i, j;\r\n\r\n    for (i = 0; i < D_NUM; ++i) {\r\n        dist[i] = 0;\r\n        for (j = 0; j < P_NUM; ++j)\r\n            dist[i] += ((q_point.p[j] - data_points[i].p[j]) * (q_point.p[j] - data_points[i].p[j]));\r\n    }\r\n\r\n    return;\r\n}\r\n\r\nvoid sift_down() \r\n{\r\n    int k = 0, p;\r\n\r\n    while (1) {\r\n        if (2 * k + 1 >= H_NUM)\r\n            break;\r\n        p = 2 * k + 1;\r\n        if ((2 * k + 2 < H_NUM) && (heap[2 * k + 2] < heap[p]))\r\n            p = 2 * k + 2;\r\n        if (heap[p] >= heap[k])\r\n            break;\r\n        heap[p] += heap[k];\r\n        heap[k] = heap[p] - heap[k];\r\n        heap[p] -= heap[k];\r\n        k = p;\r\n    }\r\n    return;\r\n}\r\n\r\nint main(int argc, char* argv[]) \r\n{\r\n    init();\r\n\r\n    int i;\r\n    clock_t start, end;\r\n    \r\n    start = clock();\r\n\r\n    calc_dis();\r\n\r\n    hn = 0;\r\n    memset(heap, 0, sizeof(heap));\r\n    for (i = 0; i < D_NUM; ++i)\r\n        if (dist[i] > heap[0]) {\r\n            heap[0] = dist[i];\r\n            sift_down();\r\n        }\r\n    \r\n    end = clock();    \r\n    \r\n    fprintf(stdout, \"Time is %.3lf\\n\", (double)(end - start) / CLOCKS_PER_SEC);\r\n    return(0);\r\n}\r\n\r\n'),(125,'Y','PROGRAM p1001(Input, Output); \r\n\r\nVAR\r\n    a, b:Integer; \r\nBEGIN\r\n    Readln(a, b); \r\n    Writeln(a + b); \r\nEND.'),(126,'Y','PROGRAM p1001(Input, Output); \r\n\r\nVAR\r\n    a, b:Integer; \r\nBEGIN\r\n    Readln(a, b); \r\n    Writeln(a + b); \r\nEND.'),(127,'Y','PROGRAM p1001(Input, Output); \r\n\r\nVAR\r\n    a, b:Integer; \r\nBEGIN\r\n    Readln(a, b); \r\n    Writeln(a + b); \r\nEND.\r\n'),(128,'Y','PROGRAM p1001(Input, Output); \r\n\r\nVAR\r\n    a, b:Integer; \r\nBEGIN\r\n    Readln(a, b); \r\n    Writeln(a + b); \r\nEND.\r\n'),(129,'Y','PROGRAM p1001(Input, Output); \r\n\r\nVAR\r\n    a, b:Integer; \r\nBEGIN\r\n    Readln(a, b); \r\n    Writeln(a + b); \r\nEND.\r\n'),(130,'Y','PROGRAM p1001(Input, Output); \r\n\r\nVAR\r\n    a, b:nteger; \r\nBEGIN\r\n    Readln(a, b); \r\n    Writeln(a + b); \r\nEND.\r\n'),(131,'Y','PROGRAM p1001(Input, Output); \r\n\r\nVAR\r\n    a, b:nteger; \r\nBEGIN\r\n    Readln(a, b); \r\n    Writeln(a + b); \r\nEND.\r\n'),(132,'Y','#include<stdio.h>\r\nint main()\r\n{\r\n    puts(\"3\");\r\n    return 0;\r\n}'),(133,'Y','#include <stdio.h>\r\nint main()\r\n{\r\n    puts(\"3\");\r\n    return 0;\r\n}'),(134,'Y','#include <stdio.h>\r\nint main()\r\n{\r\n    puts(\"3\");\r\n    return 0;\r\n}'),(135,'Y','